Mongodb merge update nested fields in a subdocument<p>I am searching if it exists, in mongodb or its nodejs driver, any method to merge/update a subdocument like this:</p>
<ul>
<li>The sample document, for example in collection <code>C</code>:</li>
</ul>
<pre><code>{
    subdocument: {
        a: 1,
        b: 2
    }
}
</code></pre>
<ul>
<li>The update query that I do NOT want to use:</li>
</ul>
<pre><code>db.C.updateOne(
    {},
    {
        $set: {
            &quot;subdocument.b&quot;: 3
        }
    }
}
</code></pre>
<ul>
<li>The update query that I want to use:</li>
</ul>
<pre><code>db.C.updateOne(
    {},
    {
        $set: {
            subdocument: {
                b: 3
            }
        }
    }
}
</code></pre>
<ul>
<li>The resulting document I get when running such a query:</li>
</ul>
<pre><code>{
    subdocument: {
        b: 3
    }
}
</code></pre>
<ul>
<li>The resulting merged document I would like to get instead:</li>
</ul>
<pre><code>{
    subdocument: {
        a: 1,
        b: 3
    }
}
</code></pre>
