<p>Obviously, the subdocument is not merged but fully replaced using the standard update witout options. I would like to know if there is a way to do this natively using mongodb query language, aggregation framework, mongodb nodejs driver, or maybe something else? From what i could learn by myself, it seems unsupported, but maybe it is and someone can tell me how?</p>
<p>Thanks</p>

