Change data type from string to date while skipping missing data<p>The core collection (other collections in the DB refer back to this one) in my DB contains 3 fields with <strong>date</strong> information which at this point is formatted as strings like <strong>MM/DD/YYYY</strong>. Further, there are a range of documents for which this field contains missing data, i.e. <strong>&quot;&quot;</strong>. I populated this collection by running the <code>mongoimport</code> command on a JSON file.</p>
<p>My goal is to convert these date-fields into actual <code>ISODate</code> data types, so as to allow filtering the collection by dates. Further, I want MongoDB to know that empty strings indicate missing values. I have read quite widely on this, leading me to try a bunch of things:</p>
<ol>
<li>Trying a <code>forEach</code> statement - This worked, but only for the very first document.</li>
</ol>
<pre><code>db.collection.find().forEach(function(element){
   element.startDate = ISODate(element.startDate);
   db.collection.save(element);
})
</code></pre>
<ol start="2">
<li>Using kind of a for-loop: this worked well, but stopped once it encountered a missing value (so it transformed about 11 values):</li>
</ol>
<pre><code>db.collection.update(
     {
        &quot;startDate&quot;:{
           &quot;$type&quot;:&quot;string&quot;
        }
     },
     [
        {
           &quot;$set&quot;:{
              &quot;startDate&quot;:{
                 &quot;$dateFromString&quot;:{
                    &quot;dateString&quot;:&quot;$startDate&quot;,
                    &quot;format&quot;:&quot;%m/%d/%Y&quot;
                 }
              }
           }
        }
     ]
  )
</code></pre>
<p>So, both of these approaches kind of worked - but I don't know how to apply them to the entire collection. Further, I'd be interested in performing this task in the most efficient way possible. However, I only want to do this once - data that will be added in the future should hopefully be correctly formatted at the import stage.</p>

